INSERT INTO `field_data_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'team', 0, 2, 2, 'und', 0, 'Klatz Startup\r\n<img src="http://geekhub.ck.ua/images/anastasia_negoda.png"/>\r\nЗакінчивши третій сезон почала працювати в стартапі Klatz. Учасник адміністративної команди GeekHub.', '', 'full_html'),
('node', 'team', 0, 3, 3, 'und', 0, 'Backend and frontend developer в\r\nMaster of Code\r\n<img src="http://geekhub.ck.ua/images/sergii_gychka.png"/>\r\nСергій займається розробкою веб проектів, використовуючи такі технології як Symfony 1, 2, Zend framework, Drupal, mysql, JS. У GeekHub Сергій викладає Advanced CMS.', '', 'full_html'),
('node', 'team', 0, 4, 4, 'und', 0, 'Senior Java Developer at\r\nSPD-Ukraine\r\n<img src="http://geekhub.ck.ua/images/bereza.png"/>\r\nАндрій - сертифікований Java 7 Programmer з великим досвідом реалізації back-end та front-end, у тому числі на проектах створення фінансових систем. У GeekHub викладає Java for Web.', '', 'full_html'),
('node', 'team', 0, 5, 5, 'und', 0, 'Lead Java Developer at\r\nSPD-Ukraine\r\n<img src="http://geekhub.ck.ua/images/jura_batora.png"/>\r\nЮра займається розробкою комерційних проектів на Java зі складною клієнт-серверною архітектурою.	У GeekHub викладає Java for Web.\r\n', '', 'full_html'),
('node', 'team', 0, 6, 6, 'und', 0, 'Frontend/Wordpress Developer в\r\nN3w Normal\r\n<img src="http://geekhub.ck.ua/images/alexander_tinyaev.png"/>\r\nАлекс (або ж Дікс, як його всі кличуть) займається Frontend, AngularJS, Sencha Touch та Wordpress розробкою в N3w Normal LLC вже протягом двох років. У GeekHub викладає Frontend + CMS.', '', 'full_html'),
('node', 'team', 0, 7, 7, 'und', 0, 'Android developer в\r\nMaster of Code\r\n<img src="http://geekhub.ck.ua/images/dmytro_tarianyk.png"/>\r\nAndroid розробник, активный учасник GDG Cherkasy. У GeekHub викладає Android. На рахунку Дмитра такі проекти як Heineken Nederland Magazine, LifeChurch Android app. У GeekHub викладає Java for Android.', '', 'full_html'),
('node', 'team', 0, 8, 8, 'und', 0, 'Project Manager at Master of Code\r\n<img src="http://geekhub.ck.ua/images/elina_vereschak.png"/>\r\nПрацює керівником проектів в компанії Master of Code. Учасник адміністративної команди GeekHub\r\n', '', 'full_html'),
('node', 'team', 0, 9, 9, 'und', 0, 'Project Manager at Master of Code\r\n<img src="http://geekhub.ck.ua/images/sergiy_kusiymov.png"/>\r\nПрацює керівником проектів в компанії Master of Code та фін.консультантом стартапу presentain.com. Учасник адміністративної команди GeekHub', '', 'full_html'),
('node', 'team', 0, 10, 10, 'und', 0, 'Designer at eKreative\r\n<img src="http://geekhub.ck.ua/images/olexandr_bula.png"/>\r\nДизайнер в eKreative. У GeekHub викладає Web & Mobile Design.\r\n', '', 'full_html'),
('node', 'team', 0, 11, 11, 'und', 0, 'Project Manager at ENKI Games\r\n<img src="http://geekhub.ck.ua/images/viktoria_odnokoz.png"/>\r\nВікторія має за плечима декілька випущених ігр у ролі від геймдизайнера до керівника проекту. Зараз у ENKI Games займається розвитком основного продукту компанії. У GeekHub викладає Game Development.', '', 'full_html'),
('node', 'team', 0, 12, 12, 'und', 0, 'Designer at Pixelgrow.co\r\n<img src="http://geekhub.ck.ua/images/tanya_ignatenko.png"/>\r\nУ Pixel Grow Тетяна займається веб дизайном та дизайном мобільних додатків. Вона приділяє багато уваги невеликим але важливим деталям. Полюбляє лаконічний дизайн та котів :) У GeekHub викладає Web & Mobile Design.', '', 'full_html'),
('node', 'team', 0, 13, 13, 'und', 0, 'Co-founder & Art director at Pixelgrow.co\r\n<img src="http://geekhub.ck.ua/images/bogdan_sviridov.png"/>\r\nБогдан має великий досвід у дизайні. Його пристрасть – зручні, прості та зрозумілі речі. У GeekHub Богдан викладає Web & Mobile Design.', '', 'full_html'),
('node', 'team', 0, 14, 14, 'und', 0, 'Backend розробник в\r\nHealthy Code, Inc.\r\n<img src="http://geekhub.ck.ua/images/polischuk.png"/>\r\nСтудент GeekHub у минулому, а зараз - backend девелопер в успішній продуктовій компанії США. Сергій полюбляє складні завдання та прості рішення. У GeekHub викладає Advanced PHP.', '', 'full_html'),
('node', 'team', 0, 15, 15, 'und', 0, 'Managing Director of eKreative\r\n<img src="http://geekhub.ck.ua/images/viktor_yevpak.png"/>\r\nLoves briniging the best in people, helping them realise their potential as professionals and humans. Has a beautiful wife and two amazing children. He is a lawyer by education, enterprenuer by calling and story-teller by hobby. У GeekHub викладає Business English.', '', 'full_html'),
('node', 'team', 0, 16, 16, 'und', 0, 'Backend and frontend developer в\r\nMaster of Code\r\n<img src="http://geekhub.ck.ua/images/yaschuk.png"/>\r\nВладислав займається розробкою веб проектів, використовуючи такі фреймворки як Symfony 2, Yii; CMS - Joomla, Wordpress, Magento. На GeekHub Владислав викладає курс Advanced CMS.\r\n\r\n', '', 'full_html'),
('node', 'team', 0, 17, 17, 'und', 0, 'Backend developer at\r\nMozidev\r\n<img src="http://geekhub.ck.ua/images/dmytro_nemesh.png"/>\r\nДмитро вже багато років розробляє web проекти, має досвід з Yii\\Yii2, Symfony2, Spring 3. Є контриб''ютором Yii2 та полюблюяє використовувати нові технології. У GeekHub викладає Advanced PHP.', '', 'full_html'),
('node', 'team', 0, 18, 18, 'und', 0, 'Designer at eKreative\r\n<img src="http://geekhub.ck.ua/images/olya_kozak.png"/>\r\nЗрозумівши, що не може жити без творчості, Ольга змінила фармацію на графічний дизайн. Ще ніразу про це не пошкодувала. Зараз займається розробкою дизайну для мобільних додатків та сайтів. У GeekHub викладає Web & Mobile Design.', '', 'full_html'),
('node', 'team', 0, 19, 19, 'und', 0, 'СTO at Presentain\r\n<img src="http://geekhub.ck.ua/images/timothy_kozak.png">\r\nТимофій працює одночасно над декількома проектами - presentain.com, vkorange.com, chedream.org, geekhub.ck.ua". У GeekHub викладає курс iOS.\r\n\r\n', '', 'full_html'),
('node', 'team', 0, 20, 20, 'und', 0, 'Head Project Manager в\r\nMaster of Code\r\n<img src="http://geekhub.ck.ua/images/alona_lisicina.png"/>\r\nАльона має науковий ступінь PhD та працює головним проектним менеджером у компанії Master of Code LLC. У Geekhub Альона викладає Project Management.', '', 'full_html'),
('node', 'team', 0, 21, 21, 'und', 0, 'Frontend developer at MasterOfCode\r\n<img src="http://geekhub.ck.ua/images/lavrenko_andriy.png"/>\r\nПрацює з рядом технологій, включаючи HTML5/CSS3, jQuery, SASS/SCSS/LESS, CoffeeScript, HAML, Twig, Require JS, Titanium SDK. Обожнює "чистий" код. У GeekHub викладає Frontend + CMS.', '', 'full_html'),
('node', 'team', 0, 22, 22, 'und', 0, 'Керуючий в everlabs\r\n<img src="http://geekhub.ck.ua/images/pasko.png"/>\r\nЗаймається розвитком компанії в цілому та розробкою окремих проектів. На рахунку Олега такі проекти як Ever.travel — сервіс планування подорожей. SeiCrm.com — CRM система страхування. та ряд інших цікавих проектів для різних компаній.', '', 'full_html'),
('node', 'team', 0, 23, 23, 'und', 0, 'CTO at eKreative\r\n<img src="http://geekhub.ck.ua/images/fred_cox.png"/>\r\nFred has been coding for over 10 years, his first mobile app was published before anyone knew what a smartphone was. Now he the techinal lead at eKreative where the focus is on web and mobile apps. Teaches Javascript at GeekHub.\r\n', '', 'full_html'),
('node', 'team', 0, 24, 24, 'und', 0, 'Управляючий партнер в\r\nMaster of Code\r\n<img src="http://geekhub.ck.ua/images/neek_kurat.png"/>\r\nНік займається розвитком бізнесу компанії Master of Code LLC та розвитком стартапу presentain.com . У складі Geekhub Нік викладає Project Management та працює над брендінгом та маркетингом проекту.', '', 'full_html'),
('node', 'team', 0, 25, 25, 'und', 0, 'Логістичний менеджер в\r\nMaster of Code\r\n<img src="http://geekhub.ck.ua/images/val.png"/>\r\nВалентин займається питаннями технічного забезпечення Geekhub.\r\n', '', 'full_html'),
('node', 'team', 0, 26, 26, 'und', 0, 'Symfony Expert у KNPLabs\r\n<img src="http://geekhub.ck.ua/images/oleg_zinchenko.png"/>\r\nОлег професiйно займаеться розробкою веб додаткiв на PHP з використанням сучасних фреймфоркiв. Адепт Symfony2 та MongoDB. Координатор та викладач напрямку Advanced PHP. Останній проект - Фітнес startup www.exercise.com\r\n', '', 'full_html'),
('node', 'team', 0, 27, 27, 'und', 0, 'English Language Tutor\r\n<img src="http://geekhub.ck.ua/images/tim_phipps.png"/>\r\nSince gaining his CELTA teaching qualification, Tim has specialised in private English lessons, meeting a wide range of student needs. At Geekhub Tim leads the Technical English course.', '', 'full_html'),
('node', 'team', 0, 28, 28, 'und', 0, 'iOS Developer at\r\nMasterOfCode\r\n<img src="http://geekhub.ck.ua/images/nadolinskiy.png"/>\r\nВін бачив багато і може з радістю цим поділитися. У GeekHub викладає iOS.\r\n\r\n', '', 'full_html'),
('node', 'team', 0, 29, 29, 'und', 0, 'CEO в N3w Normal\r\n<img src="http://geekhub.ck.ua/images/jurii_kurat.png"/>\r\nЮрій працює із командою розробників веб та кросс-платформових мобільних технологій. Його нещодавні проекти включають у себе stickyalbums.com, chewy.com. У GeekHub Юрій займається організацією та розвитком проекту.\r\n', '', 'full_html'),
('node', 'team', 0, 30, 30, 'und', 0, 'WEB Developer at\r\nMaster of Code\r\n<img src="http://geekhub.ck.ua/images/kluchnik.png"/>\r\nАктивний учасник багатьох відкритих проектів, завжди вивчає щось нове зі світу JavaScript. У GeekHub викладає Javascript.\r\n\r\n', '', 'full_html'),
('node', 'team', 0, 31, 31, 'und', 0, 'Backend/Frontend developer\r\n<img src="http://geekhub.ck.ua/images/konstantin_perevozchikov.png"/>\r\nФрілансер. frontend/backend developer веб додатків. Улюблений PHP фреймворк - Yii. Прихильник масимальної автоматизації розробки. У GeekHub викладає Advanced PHP.\r\n', '', 'full_html'),
('node', 'team', 0, 32, 32, 'und', 0, 'Project Manager \r\nMaster of Code\r\n<img src="http://geekhub.ck.ua/images/elena_perekopskaya.png"/>\r\nОлена має значний досвід у сфері контролю якості та управління проектами. У GeekHub викладає Quality Assurance.\r\n', '', 'full_html'),
('node', 'team', 0, 33, 33, 'und', 0, 'Backend and frontend developer в\r\nMaster of Code\r\n<img src="http://geekhub.ck.ua/images/piskovoj_dmitrij.png"/>\r\nДмитро займається розробкою веб проектів, використовуючи такі технології як Symfony (1, 2) , Zend Framework, Yii, nodeJs, mysql, mongoDB, JS, angular.js. У GeekHub Дмитро викладає Advanced PHP.', '', 'full_html'),
('node', 'team', 0, 34, 34, 'und', 0, 'Senior Java Developer at\r\nSPD-Ukraine\r\n<img src="http://geekhub.ck.ua/images/volodymyr_bilous.png"/>\r\nВолодимир є Java та Android розробником у SPD-Ukraine. Його основний проект -- nimblecommerce.com, що є яскравим прикладом реалізації eCommerce SaaS	У GeekHub викладає Java for Web', '', 'full_html'),
('node', 'team', 0, 35, 35, 'und', 0, 'Backend розробник в\r\nHealthy Code, Inc.\r\n<img src="http://geekhub.ck.ua/images/iana_semenova.png"/>\r\nМолода і дуже талановита. Протягом всього кількох років змогла побудувати успішну кар’єру в ІТ. У GeekHub викладає Advanced PHP.\r\n\r\n', '', 'full_html'),
('node', 'team', 0, 36, 36, 'und', 0, 'Веб-розробник в\r\nSPD-Ukraine\r\n<img src="http://geekhub.ck.ua/images/valerii_oleksienko.png"/>\r\nBackend та frontend веб-розробник. Основні технології, з якими працює: Spring (MVC, Security), Hibernate, mySql, MongoDB, jQuery, Ext.js Хоббі включають сноуборд, музика, mobile development. У GeekHub Валерій викладає JavaScript.', '', 'full_html'),
('node', 'team', 0, 37, 37, 'und', 0, 'Директор в\r\nSPD-Ukraine\r\n<img src="http://geekhub.ck.ua/images/bogdan_haliapin.png"/>\r\nБогдан керує компанією SPD-Ukraine та займається її розвитком. Має більше ніж 10 років досвіду з Java. У складі GeekHub Богдан є викладачем та координатором групи Java for Web.\r\n', '', 'full_html'),
('node', 'team', 0, 38, 38, 'und', 0, 'Office Lead at\r\nTransferWise\r\n<img src="http://geekhub.ck.ua/images/bogdan_danilyuk.png"/>\r\nБогдан один з головних розробників компанії TransferWise. Прихильник швидких, динамічних та надійних рішень у розробці програмного забезпечення. Викладатиме курс улюбленої мови програмування та фреймворку - Groovy & Grails.\r\n', '', 'full_html'),
('node', 'team', 0, 39, 39, 'und', 0, 'Android Developer в\r\nMaster of Code\r\n<img src="http://geekhub.ck.ua/images/boss.png"/>\r\nCергій протягом 4х років займається розробкою Android додатків в компанії Master Of Code. У GeekHub Сергій викладає Java for Android.', '', 'full_html'),
('node', 'team', 0, 40, 40, 'und', 0, 'Frontend/Backend developer в\r\nMasterofcode\r\n<img src="http://geekhub.ck.ua/images/jack.png">\r\nПрацює з рядом технологій, включаючи Symfony, Drupal, jQuery, Compass CSS, HAML, etc. Майстерність Євгена стоїть за такими проектами як Belvilla, Yes or No, Jongenvrij webshop, USGA та багато інших. У GeekHub викладає Frontend + CMS.\r\n', '', 'full_html'),
('node', 'team', 0, 41, 41, 'und', 0, 'QA engineer at MasterOfCode\r\n<img src="http://geekhub.ck.ua/images/irina_nikulina.png"/>\r\nВипускниця GeekHub, зараз працює QA інженером у MasterOfCode. У GeekHub викладає Quality Assurance.', '', 'full_html'),
('node', 'team', 0, 42, 42, 'und', 0, 'Senior Java/G&G Developer at\r\nTransferWise\r\n<img src="http://geekhub.ck.ua/images/vadym_vasiliev.png"/>\r\nВадим розробник у компанії TransferWise. У попередньому працював розробником та консультантом у банках різних країн Європи та світу. У GeekHub викладає Groovy & Grails.', '', 'full_html'),
('node', 'team', 0, 43, 43, 'und', 0, 'Senior Java/G&G Developer at\r\nTransferWise\r\n<img src="http://geekhub.ck.ua/images/sergiy_karpenko.png"/>\r\nСергій один з перших розробників у компанії TransferWise. У GeekHub викладає Groovy & Grails.', '', 'full_html'),
('node', 'team', 0, 44, 44, 'und', 0, 'Project Manager at eKreative\r\n<img src="http://geekhub.ck.ua/images/tanya_medvedenko.png"/>\r\nЗакінчивши третій сезон GeekHub, вирішила, що хоче робити світ кращим разом з учасниками цієї IT-community:) Працює в адміністративній команді.\r\n', '', 'full_html'),
('node', 'team', 0, 48, 48, 'und', 0, 'Eum iusto pagus pala quibus suscipit. Bene damnum haero metuo nibh occuro valetudo voco vulputate. Os praemitto sed. Iaceo nisl probo utrum uxor veniam virtus volutpat. Abdo autem ideo laoreet mauris metuo tation turpis verto. Gilvus neque typicus. Loquor nostrud obruo quia saepius tum usitas vero vulputate zelus. Antehabeo autem enim exputo illum minim modo refero ulciscor velit. Appellatio capto damnum duis patria valetudo vulputate.\n\nFacilisis imputo iusto praemitto torqueo ullamcorper valde verto. Abdo esca importunus lucidus occuro paratus secundum similis sudo. Olim pagus paulatim quadrum torqueo vereor. Decet ex iustum natu paulatim quis tego. Fere macto natu pneum turpis ulciscor ullamcorper uxor verto. Hos illum jumentum roto uxor. Aptent brevitas macto nostrud odio plaga scisco zelus.\n\nFacilisis nostrud proprius valde. Et paratus suscipit. Autem huic quae sit suscipere. Facilisi in obruo tego velit. Aliquam esca gravis letalis odio pecus quae uxor. Amet cogo huic jus pagus quadrum zelus. Appellatio caecus esca lobortis olim plaga proprius quidem usitas. Cui diam immitto jus patria ymo.\n\n', NULL, 'plain_text'),
('node', 'details', 0, 49, 49, 'und', 0, '<img src="http://geekhub.ck.ua/images/icon-frontend.png"/>\r\nЦей курс допоможе вам навчитися створювати веб сайти на основі системи керування контентом. Все, від скінування дизайну до підключення CMS. Цей курс дасть вам чудовий старт для фріланса або роботи в компанії.\r\n\r\nДокладніше + реєстрація', '', 'full_html'),
('node', 'details', 0, 50, 50, 'und', 0, '<img src="http://geekhub.ck.ua/images/icon-adv-cms.png"/>\r\nКурс для тих, хто хоче навчитися створювати сайти різного рівня складності за допомогою популярних CMS Wordpress та Drupal. Якщо ви хочете робити вебсайти як професіонал, цей курс для вас. Особливості різних CMS, використання та написання плагінів та компонентів, інтеграція із соціальними мережами та сторонніми сервісами.\r\nДокладніше + реєстрація', '', 'full_html'),
('node', 'details', 0, 51, 51, 'und', 0, '<img src="http://geekhub.ck.ua/images/icon-adv-php.png"/>\r\nДля тих хто хоче розвивати свої базові навички в PHP. Курс заглиблюється у вивчення ООП, MVC та паттернiв проетування на базі найпопулярнішого php фреймворку Symfony2.\r\nДокладніше + реєстрація', '', 'full_html'),
('node', 'details', 0, 52, 52, 'und', 0, '<img src="http://geekhub.ck.ua/images/icon-webdesign.png"/>\r\nЦе динамічний та насиченний навчальний курс, який дає змогу отримати базові знання з Веб дизайну та дизайну мобільних додатків. Ви дізнаєтесь як проектувати інтерфейси та робити сайти зручними для відвідувачів. Отримаєте базові знання по композиції, фірмовому стилю, шрифтам та роботі з ком''ютерними програмами для подальшого розвитку у галузі дизайну.\r\nДокладніше + реєстрація', '', 'full_html'),
('node', 'details', 0, 53, 53, 'und', 0, '<img src="http://geekhub.ck.ua/images/icon-english.png"/>\r\nЯкщо ви лідер команди або менеджер проектів, Business English допоможе вам здобути корисні інструменти для ефективних комунікацій як всередині команди так і з клієнтами.\r\nДокладніше + реєстрація', '', 'full_html'),
('node', 'details', 0, 54, 54, 'und', 0, '<img src="http://geekhub.ck.ua/images/icon-qa.png"/>\r\nКурс для тих, хто вміє конструктивно критикувати та хотів би з цього навику зробити цікаву інноваційну професію.\r\nДокладніше + реєстрація\r\n', '', 'full_html'),
('node', 'details', 0, 55, 55, 'und', 0, '<img src="http://geekhub.ck.ua/images/icon-pm.png"/>\r\nЩоб стати досвідченим менеджером проектів потрібні роки спроб та помилок. Geekhub дає вам можливість почати набувати практичні навички вже зараз.\r\nДокладніше + реєстрація\r\n', '', 'full_html'),
('node', 'details', 0, 56, 56, 'und', 0, '<img src="http://geekhub.ck.ua/images/icon-java.png"/>\r\nJava - це основа ентерпрайз технологій. Ви ознайомитесь із мовою, основними классами і пакетами, а також найбільш популярними та потужними фреймворками для розробки веб-додатків.\r\nДокладніше + реєстрація', '', 'full_html'),
('node', 'details', 0, 57, 57, 'und', 0, '<img src="http://geekhub.ck.ua/images/icon-grails.png"/>\r\nПознайомтесь з одним з найпотужніших фреймворків для швидкої розробки веб-додатків Groovy & Grails.\r\nДокладніше + реєстрація', '', 'full_html'),
('node', 'details', 0, 58, 58, 'und', 0, '<img src="http://geekhub.ck.ua/images/icon-ruby.png"/>\r\nКурс навчить Вас працювати з популярним фреймворком для розробки веб-сервісів на мові програмування Ruby.\r\nДокладніше + реєстрація', '', 'full_html'),
('node', 'details', 0, 59, 59, 'und', 0, '<img src="http://geekhub.ck.ua/images/icon-js.png"/>\r\nВсе найцікавіше відбувається в браузері, а не на сервері. Javascript - це той інструмент який допоможе вам створювати дійсно зручні та швидкі веб сторінки.\r\nДокладніше + реєстрація', '', 'full_html'),
('node', 'details', 0, 60, 60, 'und', 0, '<img src="http://geekhub.ck.ua/images/icon-android.png"/>\r\nAndroid - найпопулярніша операційна система для смартфонів. В цьому курсі ми охопимо найважливіші елементи побудови додатків для цієї платформи. Ознайомимося з основними компонентами UI та UX. Навчимося їх правильно використовувати. Також навчимося працювати в команді та побудуємо корисні додатки.\r\nДокладніше + реєстрація', '', 'full_html'),
('node', 'details', 0, 61, 61, 'und', 0, '<img src="http://geekhub.ck.ua/images/icon-ios.png"/>\r\nКурс для швидкого старту в розробці програмного забезпечення під популярну мобільну платформу iOS.\r\nДокладніше + реєстрація\r\n', '', 'full_html'),
('node', 'details', 0, 62, 62, 'und', 0, '<img src="http://geekhub.ck.ua/images/icon-gamedesign.png"/>\r\nЧаси, коли ігри створювали фанатики-одинаки давно позаду. Сьогодні шалено зростаюча індустрія геймдеву відкриває двері широкому колу спеціалістів. Курс Game Production познайомить учнів із процессом створення комп’ютерних ігр, особливостями ведення GDD, допоможе розібратися з ігровими механіками, жанрами, тенденціями, термінологією... А ще, надихне спостерігати, помічати, пробувати, вивчати життя, бо, як не дивно, часто саме це визначає якісний геймдев :)\r\nДокладніше + реєстрація\r\n', '', 'full_html'),
('node', 'faq', 0, 64, 64, 'und', 0, '<img src="http://geekhub.ck.ua/images/about.png"/>\r\nЯк відбувається реєстрація?\r\n\r\nЕтапи Реєстрації\r\nЗарахування на курси проходить у 4 етапи:\r\n\r\nдо 16 вересня	Реєстрація на цьому веб-сайті\r\n19 вересня	Вводне зібрання сезону - 19:00, обласна Філармонія\r\n27 вересня	Автоматизовані екзамени\r\nз 4 по 10 жовтня	Співбесіда для тих хто успішно пройшов автоматизовані екзамени\r\n13 жовтня	Початок занять для зарахованих студентів\r\nЯк підготуватися до вступних екзаменів?\r\nНа початку Серпня ми викладемо базові теми які необхідно освоїти для того щоб скласти вступний іспит. Кожен курс буде мати свій набір тем. Така система надає можливість мотивованим людям пройти на курс без попереднього досвіду у цій сфері.\r\n\r\nСкільки коштують курси?\r\nGeekHub -- це спільнота, тому курси безкоштовні. Від потенційних студентів ми вимагаємо високого рівня мотивації та багато часу роботи вдома.\r\n\r\nЧи може GeekHub допомогти мені з працевлаштуванням?\r\nМи не займаємось працевлаштуванням студентів, що успішно завершили курс. Але як сторонній ефект, Черкаські компанії, знаючи про рівень викладання і сертифікованих студентів часто звертаються до нас за рекомендаціями. За статистикою минулого року, більше 80 процентів сертифікованих студентів були запрошені на роботу.\r\n\r\nЯкий курс мені краще обрати, якщо я не маю зовсім ніякого досвіду у web?\r\nFrontend + CMS', '', 'full_html'),
('node', 'about', 0, 67, 67, 'und', 0, '<img src="http://geekhub.ck.ua/images/about.png"/>\r\nGeekHub - це проект, що надає можливість талановитій молоді отримати практичні знання та навички в сфері розробки програмного забезпечення та IT вцілому. Команда Geekhub — це группа професіоналів в інформаційних технологіях, які готують слухачів курсів до успішної кар’єри в індустрії. Всі члени команди Geekhub працюють у провідних софтверних компаніях, кожного дня оновлюючи свої знання та навички інноваціями в інформаційних технологіях. Саме це дає змогу викладати виключно потрібний матеріал, що знадобиться при роботі в реальних виробничих умовах.\r\n\r\nМи шукаємо мотивованих учнів та студентів, які мріють отримати професію в інформаційних технологіях, для інтенсивного практичного навчання з розробки веб та мобільних додатків. Ми хочемо щоб молоді таланти теж змогли приєднатись до спільноти професіоналів інформаційних технологій і створювали унікальні інтегровані продукти для поліпшення умов праці і життя людей навколо нас.\r\n\r\nМи називаємо Geekhub “Open Source”, тому що саме ця ідеологія керує всією програмою. Все що ми робимо обертається навколо взаємовідносин між людьми. Курси Geekhub не коштують грошей, все що вимагається — це внутрішня мотивація та багато самостійної роботи.\r\n\r\nЯкщо ви зацікавлені у співробітництві з GeekHub, або у вас є ідеї щодо того, як зробити GeekHub краще - будь-ласка, зв''яжіться з нами будь яким зручним для вас шляхом.', '', 'full_html');
INSERT INTO `field_revision_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'team', 0, 2, 2, 'und', 0, 'Klatz Startup\r\n<img src="http://geekhub.ck.ua/images/anastasia_negoda.png"/>\r\nЗакінчивши третій сезон почала працювати в стартапі Klatz. Учасник адміністративної команди GeekHub.', '', 'full_html'),
('node', 'team', 0, 3, 3, 'und', 0, 'Backend and frontend developer в\r\nMaster of Code\r\n<img src="http://geekhub.ck.ua/images/sergii_gychka.png"/>\r\nСергій займається розробкою веб проектів, використовуючи такі технології як Symfony 1, 2, Zend framework, Drupal, mysql, JS. У GeekHub Сергій викладає Advanced CMS.', '', 'full_html'),
('node', 'team', 0, 4, 4, 'und', 0, 'Senior Java Developer at\r\nSPD-Ukraine\r\n<img src="http://geekhub.ck.ua/images/bereza.png"/>\r\nАндрій - сертифікований Java 7 Programmer з великим досвідом реалізації back-end та front-end, у тому числі на проектах створення фінансових систем. У GeekHub викладає Java for Web.', '', 'full_html'),
('node', 'team', 0, 5, 5, 'und', 0, 'Lead Java Developer at\r\nSPD-Ukraine\r\n<img src="http://geekhub.ck.ua/images/jura_batora.png"/>\r\nЮра займається розробкою комерційних проектів на Java зі складною клієнт-серверною архітектурою.	У GeekHub викладає Java for Web.\r\n', '', 'full_html'),
('node', 'team', 0, 6, 6, 'und', 0, 'Frontend/Wordpress Developer в\r\nN3w Normal\r\n<img src="http://geekhub.ck.ua/images/alexander_tinyaev.png"/>\r\nАлекс (або ж Дікс, як його всі кличуть) займається Frontend, AngularJS, Sencha Touch та Wordpress розробкою в N3w Normal LLC вже протягом двох років. У GeekHub викладає Frontend + CMS.', '', 'full_html'),
('node', 'team', 0, 7, 7, 'und', 0, 'Android developer в\r\nMaster of Code\r\n<img src="http://geekhub.ck.ua/images/dmytro_tarianyk.png"/>\r\nAndroid розробник, активный учасник GDG Cherkasy. У GeekHub викладає Android. На рахунку Дмитра такі проекти як Heineken Nederland Magazine, LifeChurch Android app. У GeekHub викладає Java for Android.', '', 'full_html'),
('node', 'team', 0, 8, 8, 'und', 0, 'Project Manager at Master of Code\r\n<img src="http://geekhub.ck.ua/images/elina_vereschak.png"/>\r\nПрацює керівником проектів в компанії Master of Code. Учасник адміністративної команди GeekHub\r\n', '', 'full_html'),
('node', 'team', 0, 9, 9, 'und', 0, 'Project Manager at Master of Code\r\n<img src="http://geekhub.ck.ua/images/sergiy_kusiymov.png"/>\r\nПрацює керівником проектів в компанії Master of Code та фін.консультантом стартапу presentain.com. Учасник адміністративної команди GeekHub', '', 'full_html'),
('node', 'team', 0, 10, 10, 'und', 0, 'Designer at eKreative\r\n<img src="http://geekhub.ck.ua/images/olexandr_bula.png"/>\r\nДизайнер в eKreative. У GeekHub викладає Web & Mobile Design.\r\n', '', 'full_html'),
('node', 'team', 0, 11, 11, 'und', 0, 'Project Manager at ENKI Games\r\n<img src="http://geekhub.ck.ua/images/viktoria_odnokoz.png"/>\r\nВікторія має за плечима декілька випущених ігр у ролі від геймдизайнера до керівника проекту. Зараз у ENKI Games займається розвитком основного продукту компанії. У GeekHub викладає Game Development.', '', 'full_html'),
('node', 'team', 0, 12, 12, 'und', 0, 'Designer at Pixelgrow.co\r\n<img src="http://geekhub.ck.ua/images/tanya_ignatenko.png"/>\r\nУ Pixel Grow Тетяна займається веб дизайном та дизайном мобільних додатків. Вона приділяє багато уваги невеликим але важливим деталям. Полюбляє лаконічний дизайн та котів :) У GeekHub викладає Web & Mobile Design.', '', 'full_html'),
('node', 'team', 0, 13, 13, 'und', 0, 'Co-founder & Art director at Pixelgrow.co\r\n<img src="http://geekhub.ck.ua/images/bogdan_sviridov.png"/>\r\nБогдан має великий досвід у дизайні. Його пристрасть – зручні, прості та зрозумілі речі. У GeekHub Богдан викладає Web & Mobile Design.', '', 'full_html'),
('node', 'team', 0, 14, 14, 'und', 0, 'Backend розробник в\r\nHealthy Code, Inc.\r\n<img src="http://geekhub.ck.ua/images/polischuk.png"/>\r\nСтудент GeekHub у минулому, а зараз - backend девелопер в успішній продуктовій компанії США. Сергій полюбляє складні завдання та прості рішення. У GeekHub викладає Advanced PHP.', '', 'full_html'),
('node', 'team', 0, 15, 15, 'und', 0, 'Managing Director of eKreative\r\n<img src="http://geekhub.ck.ua/images/viktor_yevpak.png"/>\r\nLoves briniging the best in people, helping them realise their potential as professionals and humans. Has a beautiful wife and two amazing children. He is a lawyer by education, enterprenuer by calling and story-teller by hobby. У GeekHub викладає Business English.', '', 'full_html'),
('node', 'team', 0, 16, 16, 'und', 0, 'Backend and frontend developer в\r\nMaster of Code\r\n<img src="http://geekhub.ck.ua/images/yaschuk.png"/>\r\nВладислав займається розробкою веб проектів, використовуючи такі фреймворки як Symfony 2, Yii; CMS - Joomla, Wordpress, Magento. На GeekHub Владислав викладає курс Advanced CMS.\r\n\r\n', '', 'full_html'),
('node', 'team', 0, 17, 17, 'und', 0, 'Backend developer at\r\nMozidev\r\n<img src="http://geekhub.ck.ua/images/dmytro_nemesh.png"/>\r\nДмитро вже багато років розробляє web проекти, має досвід з Yii\\Yii2, Symfony2, Spring 3. Є контриб''ютором Yii2 та полюблюяє використовувати нові технології. У GeekHub викладає Advanced PHP.', '', 'full_html'),
('node', 'team', 0, 18, 18, 'und', 0, 'Designer at eKreative\r\n<img src="http://geekhub.ck.ua/images/olya_kozak.png"/>\r\nЗрозумівши, що не може жити без творчості, Ольга змінила фармацію на графічний дизайн. Ще ніразу про це не пошкодувала. Зараз займається розробкою дизайну для мобільних додатків та сайтів. У GeekHub викладає Web & Mobile Design.', '', 'full_html'),
('node', 'team', 0, 19, 19, 'und', 0, 'СTO at Presentain\r\n<img src="http://geekhub.ck.ua/images/timothy_kozak.png">\r\nТимофій працює одночасно над декількома проектами - presentain.com, vkorange.com, chedream.org, geekhub.ck.ua". У GeekHub викладає курс iOS.\r\n\r\n', '', 'full_html'),
('node', 'team', 0, 20, 20, 'und', 0, 'Head Project Manager в\r\nMaster of Code\r\n<img src="http://geekhub.ck.ua/images/alona_lisicina.png"/>\r\nАльона має науковий ступінь PhD та працює головним проектним менеджером у компанії Master of Code LLC. У Geekhub Альона викладає Project Management.', '', 'full_html'),
('node', 'team', 0, 21, 21, 'und', 0, 'Frontend developer at MasterOfCode\r\n<img src="http://geekhub.ck.ua/images/lavrenko_andriy.png"/>\r\nПрацює з рядом технологій, включаючи HTML5/CSS3, jQuery, SASS/SCSS/LESS, CoffeeScript, HAML, Twig, Require JS, Titanium SDK. Обожнює "чистий" код. У GeekHub викладає Frontend + CMS.', '', 'full_html'),
('node', 'team', 0, 22, 22, 'und', 0, 'Керуючий в everlabs\r\n<img src="http://geekhub.ck.ua/images/pasko.png"/>\r\nЗаймається розвитком компанії в цілому та розробкою окремих проектів. На рахунку Олега такі проекти як Ever.travel — сервіс планування подорожей. SeiCrm.com — CRM система страхування. та ряд інших цікавих проектів для різних компаній.', '', 'full_html'),
('node', 'team', 0, 23, 23, 'und', 0, 'CTO at eKreative\r\n<img src="http://geekhub.ck.ua/images/fred_cox.png"/>\r\nFred has been coding for over 10 years, his first mobile app was published before anyone knew what a smartphone was. Now he the techinal lead at eKreative where the focus is on web and mobile apps. Teaches Javascript at GeekHub.\r\n', '', 'full_html'),
('node', 'team', 0, 24, 24, 'und', 0, 'Управляючий партнер в\r\nMaster of Code\r\n<img src="http://geekhub.ck.ua/images/neek_kurat.png"/>\r\nНік займається розвитком бізнесу компанії Master of Code LLC та розвитком стартапу presentain.com . У складі Geekhub Нік викладає Project Management та працює над брендінгом та маркетингом проекту.', '', 'full_html'),
('node', 'team', 0, 25, 25, 'und', 0, 'Логістичний менеджер в\r\nMaster of Code\r\n<img src="http://geekhub.ck.ua/images/val.png"/>\r\nВалентин займається питаннями технічного забезпечення Geekhub.\r\n', '', 'full_html'),
('node', 'team', 0, 26, 26, 'und', 0, 'Symfony Expert у KNPLabs\r\n<img src="http://geekhub.ck.ua/images/oleg_zinchenko.png"/>\r\nОлег професiйно займаеться розробкою веб додаткiв на PHP з використанням сучасних фреймфоркiв. Адепт Symfony2 та MongoDB. Координатор та викладач напрямку Advanced PHP. Останній проект - Фітнес startup www.exercise.com\r\n', '', 'full_html'),
('node', 'team', 0, 27, 27, 'und', 0, 'English Language Tutor\r\n<img src="http://geekhub.ck.ua/images/tim_phipps.png"/>\r\nSince gaining his CELTA teaching qualification, Tim has specialised in private English lessons, meeting a wide range of student needs. At Geekhub Tim leads the Technical English course.', '', 'full_html'),
('node', 'team', 0, 28, 28, 'und', 0, 'iOS Developer at\r\nMasterOfCode\r\n<img src="http://geekhub.ck.ua/images/nadolinskiy.png"/>\r\nВін бачив багато і може з радістю цим поділитися. У GeekHub викладає iOS.\r\n\r\n', '', 'full_html'),
('node', 'team', 0, 29, 29, 'und', 0, 'CEO в N3w Normal\r\n<img src="http://geekhub.ck.ua/images/jurii_kurat.png"/>\r\nЮрій працює із командою розробників веб та кросс-платформових мобільних технологій. Його нещодавні проекти включають у себе stickyalbums.com, chewy.com. У GeekHub Юрій займається організацією та розвитком проекту.\r\n', '', 'full_html'),
('node', 'team', 0, 30, 30, 'und', 0, 'WEB Developer at\r\nMaster of Code\r\n<img src="http://geekhub.ck.ua/images/kluchnik.png"/>\r\nАктивний учасник багатьох відкритих проектів, завжди вивчає щось нове зі світу JavaScript. У GeekHub викладає Javascript.\r\n\r\n', '', 'full_html'),
('node', 'team', 0, 31, 31, 'und', 0, 'Backend/Frontend developer\r\n<img src="http://geekhub.ck.ua/images/konstantin_perevozchikov.png"/>\r\nФрілансер. frontend/backend developer веб додатків. Улюблений PHP фреймворк - Yii. Прихильник масимальної автоматизації розробки. У GeekHub викладає Advanced PHP.\r\n', '', 'full_html'),
('node', 'team', 0, 32, 32, 'und', 0, 'Project Manager \r\nMaster of Code\r\n<img src="http://geekhub.ck.ua/images/elena_perekopskaya.png"/>\r\nОлена має значний досвід у сфері контролю якості та управління проектами. У GeekHub викладає Quality Assurance.\r\n', '', 'full_html'),
('node', 'team', 0, 33, 33, 'und', 0, 'Backend and frontend developer в\r\nMaster of Code\r\n<img src="http://geekhub.ck.ua/images/piskovoj_dmitrij.png"/>\r\nДмитро займається розробкою веб проектів, використовуючи такі технології як Symfony (1, 2) , Zend Framework, Yii, nodeJs, mysql, mongoDB, JS, angular.js. У GeekHub Дмитро викладає Advanced PHP.', '', 'full_html'),
('node', 'team', 0, 34, 34, 'und', 0, 'Senior Java Developer at\r\nSPD-Ukraine\r\n<img src="http://geekhub.ck.ua/images/volodymyr_bilous.png"/>\r\nВолодимир є Java та Android розробником у SPD-Ukraine. Його основний проект -- nimblecommerce.com, що є яскравим прикладом реалізації eCommerce SaaS	У GeekHub викладає Java for Web', '', 'full_html'),
('node', 'team', 0, 35, 35, 'und', 0, 'Backend розробник в\r\nHealthy Code, Inc.\r\n<img src="http://geekhub.ck.ua/images/iana_semenova.png"/>\r\nМолода і дуже талановита. Протягом всього кількох років змогла побудувати успішну кар’єру в ІТ. У GeekHub викладає Advanced PHP.\r\n\r\n', '', 'full_html'),
('node', 'team', 0, 36, 36, 'und', 0, 'Веб-розробник в\r\nSPD-Ukraine\r\n<img src="http://geekhub.ck.ua/images/valerii_oleksienko.png"/>\r\nBackend та frontend веб-розробник. Основні технології, з якими працює: Spring (MVC, Security), Hibernate, mySql, MongoDB, jQuery, Ext.js Хоббі включають сноуборд, музика, mobile development. У GeekHub Валерій викладає JavaScript.', '', 'full_html'),
('node', 'team', 0, 37, 37, 'und', 0, 'Директор в\r\nSPD-Ukraine\r\n<img src="http://geekhub.ck.ua/images/bogdan_haliapin.png"/>\r\nБогдан керує компанією SPD-Ukraine та займається її розвитком. Має більше ніж 10 років досвіду з Java. У складі GeekHub Богдан є викладачем та координатором групи Java for Web.\r\n', '', 'full_html'),
('node', 'team', 0, 38, 38, 'und', 0, 'Office Lead at\r\nTransferWise\r\n<img src="http://geekhub.ck.ua/images/bogdan_danilyuk.png"/>\r\nБогдан один з головних розробників компанії TransferWise. Прихильник швидких, динамічних та надійних рішень у розробці програмного забезпечення. Викладатиме курс улюбленої мови програмування та фреймворку - Groovy & Grails.\r\n', '', 'full_html'),
('node', 'team', 0, 39, 39, 'und', 0, 'Android Developer в\r\nMaster of Code\r\n<img src="http://geekhub.ck.ua/images/boss.png"/>\r\nCергій протягом 4х років займається розробкою Android додатків в компанії Master Of Code. У GeekHub Сергій викладає Java for Android.', '', 'full_html'),
('node', 'team', 0, 40, 40, 'und', 0, 'Frontend/Backend developer в\r\nMasterofcode\r\n<img src="http://geekhub.ck.ua/images/jack.png">\r\nПрацює з рядом технологій, включаючи Symfony, Drupal, jQuery, Compass CSS, HAML, etc. Майстерність Євгена стоїть за такими проектами як Belvilla, Yes or No, Jongenvrij webshop, USGA та багато інших. У GeekHub викладає Frontend + CMS.\r\n', '', 'full_html'),
('node', 'team', 0, 41, 41, 'und', 0, 'QA engineer at MasterOfCode\r\n<img src="http://geekhub.ck.ua/images/irina_nikulina.png"/>\r\nВипускниця GeekHub, зараз працює QA інженером у MasterOfCode. У GeekHub викладає Quality Assurance.', '', 'full_html'),
('node', 'team', 0, 42, 42, 'und', 0, 'Senior Java/G&G Developer at\r\nTransferWise\r\n<img src="http://geekhub.ck.ua/images/vadym_vasiliev.png"/>\r\nВадим розробник у компанії TransferWise. У попередньому працював розробником та консультантом у банках різних країн Європи та світу. У GeekHub викладає Groovy & Grails.', '', 'full_html'),
('node', 'team', 0, 43, 43, 'und', 0, 'Senior Java/G&G Developer at\r\nTransferWise\r\n<img src="http://geekhub.ck.ua/images/sergiy_karpenko.png"/>\r\nСергій один з перших розробників у компанії TransferWise. У GeekHub викладає Groovy & Grails.', '', 'full_html'),
('node', 'team', 0, 44, 44, 'und', 0, 'Project Manager at eKreative\r\n<img src="http://geekhub.ck.ua/images/tanya_medvedenko.png"/>\r\nЗакінчивши третій сезон GeekHub, вирішила, що хоче робити світ кращим разом з учасниками цієї IT-community:) Працює в адміністративній команді.\r\n', '', 'full_html'),
('node', 'team', 0, 48, 48, 'und', 0, 'Eum iusto pagus pala quibus suscipit. Bene damnum haero metuo nibh occuro valetudo voco vulputate. Os praemitto sed. Iaceo nisl probo utrum uxor veniam virtus volutpat. Abdo autem ideo laoreet mauris metuo tation turpis verto. Gilvus neque typicus. Loquor nostrud obruo quia saepius tum usitas vero vulputate zelus. Antehabeo autem enim exputo illum minim modo refero ulciscor velit. Appellatio capto damnum duis patria valetudo vulputate.\n\nFacilisis imputo iusto praemitto torqueo ullamcorper valde verto. Abdo esca importunus lucidus occuro paratus secundum similis sudo. Olim pagus paulatim quadrum torqueo vereor. Decet ex iustum natu paulatim quis tego. Fere macto natu pneum turpis ulciscor ullamcorper uxor verto. Hos illum jumentum roto uxor. Aptent brevitas macto nostrud odio plaga scisco zelus.\n\nFacilisis nostrud proprius valde. Et paratus suscipit. Autem huic quae sit suscipere. Facilisi in obruo tego velit. Aliquam esca gravis letalis odio pecus quae uxor. Amet cogo huic jus pagus quadrum zelus. Appellatio caecus esca lobortis olim plaga proprius quidem usitas. Cui diam immitto jus patria ymo.\n\n', NULL, 'plain_text'),
('node', 'details', 0, 49, 49, 'und', 0, '<img src="http://geekhub.ck.ua/images/icon-frontend.png"/>\r\nЦей курс допоможе вам навчитися створювати веб сайти на основі системи керування контентом. Все, від скінування дизайну до підключення CMS. Цей курс дасть вам чудовий старт для фріланса або роботи в компанії.\r\n\r\nДокладніше + реєстрація', '', 'full_html'),
('node', 'details', 0, 50, 50, 'und', 0, '<img src="http://geekhub.ck.ua/images/icon-adv-cms.png"/>\r\nКурс для тих, хто хоче навчитися створювати сайти різного рівня складності за допомогою популярних CMS Wordpress та Drupal. Якщо ви хочете робити вебсайти як професіонал, цей курс для вас. Особливості різних CMS, використання та написання плагінів та компонентів, інтеграція із соціальними мережами та сторонніми сервісами.\r\nДокладніше + реєстрація', '', 'full_html'),
('node', 'details', 0, 51, 51, 'und', 0, '<img src="http://geekhub.ck.ua/images/icon-adv-php.png"/>\r\nДля тих хто хоче розвивати свої базові навички в PHP. Курс заглиблюється у вивчення ООП, MVC та паттернiв проетування на базі найпопулярнішого php фреймворку Symfony2.\r\nДокладніше + реєстрація', '', 'full_html'),
('node', 'details', 0, 52, 52, 'und', 0, '<img src="http://geekhub.ck.ua/images/icon-webdesign.png"/>\r\nЦе динамічний та насиченний навчальний курс, який дає змогу отримати базові знання з Веб дизайну та дизайну мобільних додатків. Ви дізнаєтесь як проектувати інтерфейси та робити сайти зручними для відвідувачів. Отримаєте базові знання по композиції, фірмовому стилю, шрифтам та роботі з ком''ютерними програмами для подальшого розвитку у галузі дизайну.\r\nДокладніше + реєстрація', '', 'full_html'),
('node', 'details', 0, 53, 53, 'und', 0, '<img src="http://geekhub.ck.ua/images/icon-english.png"/>\r\nЯкщо ви лідер команди або менеджер проектів, Business English допоможе вам здобути корисні інструменти для ефективних комунікацій як всередині команди так і з клієнтами.\r\nДокладніше + реєстрація', '', 'full_html'),
('node', 'details', 0, 54, 54, 'und', 0, '<img src="http://geekhub.ck.ua/images/icon-qa.png"/>\r\nКурс для тих, хто вміє конструктивно критикувати та хотів би з цього навику зробити цікаву інноваційну професію.\r\nДокладніше + реєстрація\r\n', '', 'full_html'),
('node', 'details', 0, 55, 55, 'und', 0, '<img src="http://geekhub.ck.ua/images/icon-pm.png"/>\r\nЩоб стати досвідченим менеджером проектів потрібні роки спроб та помилок. Geekhub дає вам можливість почати набувати практичні навички вже зараз.\r\nДокладніше + реєстрація\r\n', '', 'full_html'),
('node', 'details', 0, 56, 56, 'und', 0, '<img src="http://geekhub.ck.ua/images/icon-java.png"/>\r\nJava - це основа ентерпрайз технологій. Ви ознайомитесь із мовою, основними классами і пакетами, а також найбільш популярними та потужними фреймворками для розробки веб-додатків.\r\nДокладніше + реєстрація', '', 'full_html'),
('node', 'details', 0, 57, 57, 'und', 0, '<img src="http://geekhub.ck.ua/images/icon-grails.png"/>\r\nПознайомтесь з одним з найпотужніших фреймворків для швидкої розробки веб-додатків Groovy & Grails.\r\nДокладніше + реєстрація', '', 'full_html'),
('node', 'details', 0, 58, 58, 'und', 0, '<img src="http://geekhub.ck.ua/images/icon-ruby.png"/>\r\nКурс навчить Вас працювати з популярним фреймворком для розробки веб-сервісів на мові програмування Ruby.\r\nДокладніше + реєстрація', '', 'full_html'),
('node', 'details', 0, 59, 59, 'und', 0, '<img src="http://geekhub.ck.ua/images/icon-js.png"/>\r\nВсе найцікавіше відбувається в браузері, а не на сервері. Javascript - це той інструмент який допоможе вам створювати дійсно зручні та швидкі веб сторінки.\r\nДокладніше + реєстрація', '', 'full_html'),
('node', 'details', 0, 60, 60, 'und', 0, '<img src="http://geekhub.ck.ua/images/icon-android.png"/>\r\nAndroid - найпопулярніша операційна система для смартфонів. В цьому курсі ми охопимо найважливіші елементи побудови додатків для цієї платформи. Ознайомимося з основними компонентами UI та UX. Навчимося їх правильно використовувати. Також навчимося працювати в команді та побудуємо корисні додатки.\r\nДокладніше + реєстрація', '', 'full_html'),
('node', 'details', 0, 61, 61, 'und', 0, '<img src="http://geekhub.ck.ua/images/icon-ios.png"/>\r\nКурс для швидкого старту в розробці програмного забезпечення під популярну мобільну платформу iOS.\r\nДокладніше + реєстрація\r\n', '', 'full_html'),
('node', 'details', 0, 62, 62, 'und', 0, '<img src="http://geekhub.ck.ua/images/icon-gamedesign.png"/>\r\nЧаси, коли ігри створювали фанатики-одинаки давно позаду. Сьогодні шалено зростаюча індустрія геймдеву відкриває двері широкому колу спеціалістів. Курс Game Production познайомить учнів із процессом створення комп’ютерних ігр, особливостями ведення GDD, допоможе розібратися з ігровими механіками, жанрами, тенденціями, термінологією... А ще, надихне спостерігати, помічати, пробувати, вивчати життя, бо, як не дивно, часто саме це визначає якісний геймдев :)\r\nДокладніше + реєстрація\r\n', '', 'full_html'),
('node', 'faq', 0, 64, 64, 'und', 0, '<img src="http://geekhub.ck.ua/images/about.png"/>\r\nЯк відбувається реєстрація?\r\n\r\nЕтапи Реєстрації\r\nЗарахування на курси проходить у 4 етапи:\r\n\r\nдо 16 вересня	Реєстрація на цьому веб-сайті\r\n19 вересня	Вводне зібрання сезону - 19:00, обласна Філармонія\r\n27 вересня	Автоматизовані екзамени\r\nз 4 по 10 жовтня	Співбесіда для тих хто успішно пройшов автоматизовані екзамени\r\n13 жовтня	Початок занять для зарахованих студентів\r\nЯк підготуватися до вступних екзаменів?\r\nНа початку Серпня ми викладемо базові теми які необхідно освоїти для того щоб скласти вступний іспит. Кожен курс буде мати свій набір тем. Така система надає можливість мотивованим людям пройти на курс без попереднього досвіду у цій сфері.\r\n\r\nСкільки коштують курси?\r\nGeekHub -- це спільнота, тому курси безкоштовні. Від потенційних студентів ми вимагаємо високого рівня мотивації та багато часу роботи вдома.\r\n\r\nЧи може GeekHub допомогти мені з працевлаштуванням?\r\nМи не займаємось працевлаштуванням студентів, що успішно завершили курс. Але як сторонній ефект, Черкаські компанії, знаючи про рівень викладання і сертифікованих студентів часто звертаються до нас за рекомендаціями. За статистикою минулого року, більше 80 процентів сертифікованих студентів були запрошені на роботу.\r\n\r\nЯкий курс мені краще обрати, якщо я не маю зовсім ніякого досвіду у web?\r\nFrontend + CMS', '', 'full_html'),
('node', 'about', 0, 67, 67, 'und', 0, '<img src="http://geekhub.ck.ua/images/about.png"/>\r\nGeekHub - це проект, що надає можливість талановитій молоді отримати практичні знання та навички в сфері розробки програмного забезпечення та IT вцілому. Команда Geekhub — це группа професіоналів в інформаційних технологіях, які готують слухачів курсів до успішної кар’єри в індустрії. Всі члени команди Geekhub працюють у провідних софтверних компаніях, кожного дня оновлюючи свої знання та навички інноваціями в інформаційних технологіях. Саме це дає змогу викладати виключно потрібний матеріал, що знадобиться при роботі в реальних виробничих умовах.\r\n\r\nМи шукаємо мотивованих учнів та студентів, які мріють отримати професію в інформаційних технологіях, для інтенсивного практичного навчання з розробки веб та мобільних додатків. Ми хочемо щоб молоді таланти теж змогли приєднатись до спільноти професіоналів інформаційних технологій і створювали унікальні інтегровані продукти для поліпшення умов праці і життя людей навколо нас.\r\n\r\nМи називаємо Geekhub “Open Source”, тому що саме ця ідеологія керує всією програмою. Все що ми робимо обертається навколо взаємовідносин між людьми. Курси Geekhub не коштують грошей, все що вимагається — це внутрішня мотивація та багато самостійної роботи.\r\n\r\nЯкщо ви зацікавлені у співробітництві з GeekHub, або у вас є ідеї щодо того, як зробити GeekHub краще - будь-ласка, зв''яжіться з нами будь яким зручним для вас шляхом.', '', 'full_html');
